import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'https://s178vla.storage.yandex.net/rdisk/e31a750cb3c500e85cebc68c825270f21ab5c8502020ee78b7fbf7f271bb39b0/605b9c59/gpr6fgFn4faZ3Q2Dotp-k828PEMVs0Xk25JtzFpLSkVxpfRFZZqROSCpA2VkxyAY7nv7KDVl_P4Zd5oGqfTQ1A==?uid=0&filename=main_background.jpg&disposition=inline&hash=&limit=0&content_type=image%2Fjpeg&owner_uid=0&fsize=1055850&hid=e5131da116641ad490332a88c15d527d&media_type=image&tknv=v2&etag=7823100e125a46ae78894c65dbd3a4b7&rtoken=pauDy4bK6nZV&force_default=no&ycrid=na-b8a885a6034a5084333a3e9eca3bef24-downloader6e&ts=5be4dde6d0840&s=5024abbb0aebe5d1b8488922b4cea5caed51b9cae74c7300f72456eb6d804e43&pb=U2FsdGVkX1-e9LkYO4Q6YXY0XL3l5e4y_Hl8O55h-dXJ1DvfMo29zlsMwgJzBJD_Be2lF45nsCM-9pu84U-nz08NlxWZxn1FzJk-MsDwq6c'} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
